import { BaseNode } from "./BaseNode";

export const InputNode = ({ id, data }) => {
  return (
    <BaseNode
      id={id}
      title="Input"
      data={data}
      inputs={[
        { label: "Name", key: "inputName", type: "text" },
        {
          label: "Type",
          key: "inputType",
          type: "select",
          options: ["Text", "File"],
        },
      ]}
      rightHandles={[{ id: `${id}-value`, style: {} }]}
    />
  );
};
